import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 3.2-5208 Powers and duties of State Health Commissioner; obstruction unlawful.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-5208.md","filePath":"vacode/3.2-5208.md"}'),o={name:"vacode/3.2-5208.md"},s=r('<h1 id="§-3-2-5208-powers-and-duties-of-state-health-commissioner-obstruction-unlawful" tabindex="-1">§ 3.2-5208 Powers and duties of State Health Commissioner; obstruction unlawful. <a class="header-anchor" href="#§-3-2-5208-powers-and-duties-of-state-health-commissioner-obstruction-unlawful" aria-label="Permalink to &quot;§ 3.2-5208 Powers and duties of State Health Commissioner; obstruction unlawful.&quot;">​</a></h1><p>The State Health Commissioner, pursuant to the regulations adopted pursuant to § <a href="http://law.lis.virginia.gov/vacode/3.2-5206/" target="_blank" rel="noreferrer">3.2-5206</a>, shall issue permits to all plants that process and distribute Grade A market milk and Grade A market milk products. The State Health Commissioner shall also enforce the regulations adopted under § <a href="http://law.lis.virginia.gov/vacode/3.2-5206/" target="_blank" rel="noreferrer">3.2-5206</a> in all plants from the point of delivery at the plant to the consumer. He is empowered, in the performance of his duties, to enter upon and to have free access to any establishment or area subject to the provisions of this article, or the regulations adopted hereunder, pertaining to the processing and distribution of Grade A market milk, Grade A market milk products, ungraded milk products, and those products manufactured in semblance to or as substitutes in Grade A market milk and Grade A market milk products plants from the point of delivery at the plant to the consumer. It shall be unlawful for any person to hinder, obstruct, or interfere with the State Health Commissioner in the performance of his duties under this article or under the regulations adopted hereunder.</p><p>1970, c. 49, § 3.1-530.4; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0860" target="_blank" rel="noreferrer">860</a>.</p>',3),n=[s];function i(l,d,u,h,c,m){return t(),a("div",null,n)}const _=e(o,[["render",i]]);export{f as __pageData,_ as default};
